pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;


import "../interfaces/IRegistryFactory.sol";
import "../interfaces/IVoteController.sol";
import "./ChallengeableRegistry.sol";
import "../interfaces/IParameterSource.sol";

contract RegistryFactory is IRegistryFactory { 

    address private parametersAddress;

    uint256  public constant DEFAULT_MIN_STAKE = 1;
    uint256  public constant DEFAULT_MIN_VOTE_STAKE = 1;
    uint  public constant DEFAULT_CHALLENGE_PENALTY = 50;
    uint  public constant DEFAULT_CHALLENGE_DISTRIBUTION = 50;
    uint  public constant DEFAULT_VOTE_PENALTY = 10;
    uint  public constant DEFAULT_CHALLENGE_LENGTH = 24 * 60 * 60;

    constructor(address _parametersAddress) public { 
        require(_parametersAddress != address(0), "Parameter address must be set.");
        parametersAddress = _parametersAddress;
    }

    function create(string _voteStyle) public returns (address _newAddress) {

        // Ensure there is an implementation for the vote style

        // address voteAddress = IParameterSource(parametersAddress).getAddress("VOTE", _voteStyle);

        // require(voteAddress != address(0), "Vote style must be known to parameter source");

        address newRegistry = new ChallengeableRegistry(
            parametersAddress,
            DEFAULT_MIN_STAKE, 
            _voteStyle,
            DEFAULT_CHALLENGE_PENALTY,
            DEFAULT_VOTE_PENALTY,
            DEFAULT_CHALLENGE_LENGTH,
            DEFAULT_CHALLENGE_DISTRIBUTION,
            DEFAULT_MIN_VOTE_STAKE,
            DEFAULT_MIN_VOTE_STAKE
        );

        return newRegistry;
    }
}
